"use strict";(globalThis.webpackChunkbook_source=globalThis.webpackChunkbook_source||[]).push([[747],{6641:a=>{a.exports=JSON.parse('{"tag":{"label":"sim-to-real","permalink":"/hackathon-phase-01/docs/tags/sim-to-real","allTagsPath":"/hackathon-phase-01/docs/tags","count":2,"items":[{"id":"Physical-AI-Humanoid-Robotics/isaac-ai-brain/integration-autonomous-navigation","title":"Integration: Autonomous Navigation System","description":"The true power of the NVIDIA Isaac platform emerges when Isaac Sim, Isaac ROS, and Nav2 work together as an integrated autonomous navigation system. This integration creates a complete pipeline from simulation and training through real-time perception and navigation, enabling humanoid robots to operate autonomously in complex environments. Understanding how these components connect and exchange information is essential for designing effective autonomous systems.","permalink":"/hackathon-phase-01/docs/Physical-AI-Humanoid-Robotics/isaac-ai-brain/integration-autonomous-navigation"},{"id":"Physical-AI-Humanoid-Robotics/isaac-ai-brain/isaac-sim-simulation","title":"Isaac Sim for Photorealistic Simulation","description":"Isaac Sim is NVIDIA\'s advanced robotics simulation environment built on the Omniverse platform. It provides photorealistic rendering capabilities that enable roboticists to train and test robots in virtual worlds that closely match real-world conditions. For humanoid robots, Isaac Sim offers the ability to generate unlimited synthetic sensor data, test navigation and manipulation tasks safely, and experiment with different environmental conditions without physical hardware.","permalink":"/hackathon-phase-01/docs/Physical-AI-Humanoid-Robotics/isaac-ai-brain/isaac-sim-simulation"}],"unlisted":false}}')}}]);